A térképadatok betöltése sikertelen, a helyi gyorsítótárból sem található érvényes térkép. Kérjük, ellenőrizze:
1. A hálózati kapcsolatot;
2. Helyesen van-e beállítva a térképalias;
3. Van-e pont megjelölve a lifthez;
4. Vannak-e érvényes pontok és útvonalak a térképen.

A térképadatok sikeresen betöltve, de nem található érvényes térkép. Kérjük, ellenőrizze:
1. Helyesen van-e beállítva a térképalias;
2. Van-e pont megjelölve a lifthez;
3. Vannak-e érvényes pontok és útvonalak a térképen.
